                    className={agreeOpen ? 'absolute bottom-0 left-0 w-full h-[10px] bg-white rounded-t-lg animate-[card-sheet-up_800ms_ease-in-out]' : 'absolute bottom-0 h-[678px] left-0  rounded-t-lg w-screen bg-white animate-[card-sheet-down_800ms_ease-in-out]'}>
                    <button onClick={(e: React.MouseEvent<HTMLButtonElement>) => setAgreeOpen(false)}>닫기</button>
                </div>
            </div>
    )
}
